import React, { Component } from 'react'
import AuthenticationService from './AuthenticationService.js'
import GoogleLogin from 'react-google-login';

class LoginComponent extends Component {

    constructor(props) {
        super(props)

        this.state = {
            hasLoginFailed: false,
            showSuccessMessage: false
        }
        this.responseGoogle = this.responseGoogle.bind(this)
    }

    responseGoogle(response){
        AuthenticationService.registerSuccessfulLogin(response.profileObj.givenName, response.profileObj.email)
        
        this.props.history.push(`/welcome/${response.profileObj.givenName}`)
        // this.setState({showSuccessMessage:false, hasLoginFailed:true})
        
        // AuthenticationService
        //     .executeJwtAuthenticationService(response.profileObj.givenName)
        //     .then((response) => {
        //         AuthenticationService.registerSuccessfulLoginForJwt(response.profileObj.givenName, response.tokenId)
        //         this.props.history.push(`/welcome/${response.profileObj.givenName}`)
        //     }).catch(() => {
        //         this.setState({ showSuccessMessage: false })
        //         this.setState({ hasLoginFailed: true })
        //     })
    }

    render() {
        return (
            <div>
                <h1>Login</h1>
                <GoogleLogin
                    clientId="523292681676-qqq33easshjp33p16ou9hk4buhh17enf.apps.googleusercontent.com"
                    buttonText="Login"
                    onSuccess={this.responseGoogle}
                    onFailure={this.responseGoogle}
                    cookiePolicy={'single_host_origin'}
                />
            </div>
        )
    }
}

export default LoginComponent
